import React from "react";
import bank from "./Redux/bank";
import { Provider } from "react-redux";
import ReactDOM from "react-dom";
import App from "./App";

const container = document.getElementbyId("root");
// create a root
const root = ReactDOM.createRoot(container);
// render app to root
root.render(
  <Provider store={bank}>
    <App />
  </Provider>
);
